  /**
   * Overrides the ancestor's method
   * 
   * @param __app
   */
  @Override
public void setApplication ( RallyApplication __app )
  {
    this.app = ( SAIC_DMQ_ORA_Application ) __app;
    if ( this.app != null )
    {
      this.dm = ( RallyDataManager ) this.app.getDataManager ( );
    }
  }


  /**
   * Overrides the ancestor's method
   * 
   * @param parms
   */
  @Override
public void execute ( ParameterSet parms )
  {
    this.process ( parms );
  }




  /**
   *
   */
  protected void doReturn ( )
  {
    this.unregister ( );
  }


  /**
   *
   */
  public void unregister ( )
  {
    this.app.unregister ( this );
    IRegisteredObject rObj = this.app.get ( "ADSEF_TANF_06A_ADL" );
    if ( rObj != null && rObj instanceof ADSEF_TANF_06A_ADL )
    {
      this.app.setADL ( ADSEF_TANF_06A_ADL.class, ( ADSEF_TANF_06A_ADL ) rObj );
    }
  }


  /**
   * Overrides the ancestor's method
   * 
   * @param ps
   */
  @Override
protected void process ( ParameterSet ps )
  {
    Debug.println ( Debug.TRACE, "ADSEF_TANF_06A_ADL Step " + this.currentStep );
    super.process ( ps );
    switch ( this.currentStep ) 
    {
      case 0:  { this.currentStep ++; this.step0 ( this.keyParms ); break; }
      case 1:  { this.currentStep ++; this.step1 ( this.keyParms ); break; }
      case 2:  { this.currentStep ++; this.step2 ( this.keyParms ); break; }
      case 3:  { this.currentStep ++; this.step3 ( this.keyParms ); break; }
      default: 
      { 
        this.currentStep = 0;
        Debug.println ( Debug.TRACE, "ADSEF_TANF_06A_ADL ended" );
        this.unregister ( );
        break;
      }
    }
    if ( this.currentStep > 0 ) this.app.goOn ( );
  }



  /**
   *
   */
  protected void step0 ( ParameterSet ps )
  {

    this.callParms.clear ( );
    this.callParms.set ( this.app.SS_SERV_GBL  );
    this.callParms.set ( NOMBREFAM  );
    NOMBRE_COMPLETO_ADL.exec ( this.app, this.callParms );
    return;

  }


  /**
   *
   */
  protected void step1 ( ParameterSet ps )
  {
    this.callParms.reset ( );
    this.app.SS_SERV_GBL  = this.callParms.getDouble ( );
    NOMBREFAM  = this.callParms.getString ( );

    TIPO = "POST";

    this.callParms.clear ( );
    this.callParms.set ( this.app.SS_JEFE_GBL  );
    this.callParms.set ( TIPO  );
    this.callParms.set ( DIRL1  );
    this.callParms.set ( DIRL2  );
    this.callParms.set ( ZP  );
    this.callParms.set ( ZP4  );
    this.callParms.set ( CIUDADR  );
    this.callParms.set ( PAISR  );
    DIRECCION_ADL.exec ( this.app, this.callParms );
    return;

  }


  /**
   *
   */
  protected void step2 ( ParameterSet ps )
  {
    this.callParms.reset ( );
    this.app.SS_JEFE_GBL  = this.callParms.getDouble ( );
    TIPO  = this.callParms.getString ( );
    DIRL1  = this.callParms.getString ( );
    DIRL2  = this.callParms.getString ( );
    ZP  = this.callParms.getDouble ( );
    ZP4  = this.callParms.getDouble ( );
    CIUDADR  = this.callParms.getString ( );
    PAISR  = this.callParms.getString ( );

    if ( Compare.equals ( DIRL1, " " ) ) 
    {
      this._condition0 = true;
    }
    else
    {
      this._condition0 = false;
    }
    if ( this._condition0 )
    {
      TIPO = "RESI";

      this.callParms.clear ( );
      this.callParms.set ( this.app.SS_JEFE_GBL  );
      this.callParms.set ( TIPO  );
      this.callParms.set ( DIRL1  );
      this.callParms.set ( DIRL2  );
      this.callParms.set ( ZP  );
      this.callParms.set ( ZP4  );
      this.callParms.set ( CIUDADR  );
      this.callParms.set ( PAISR  );
      DIRECCION_ADL.exec ( this.app, this.callParms );
      return;
    }

  }


  /**
   *
   */
  protected void step3 ( ParameterSet ps )
  {
    if ( this._condition0 )    //    if ( Compare.equals ( DIRL1, " " ) ) 
    {
      this.callParms.reset ( );
      this.app.SS_JEFE_GBL  = this.callParms.getDouble ( );
      TIPO  = this.callParms.getString ( );
      DIRL1  = this.callParms.getString ( );
      DIRL2  = this.callParms.getString ( );
      ZP  = this.callParms.getDouble ( );
      ZP4  = this.callParms.getDouble ( );
      CIUDADR  = this.callParms.getString ( );
      PAISR  = this.callParms.getString ( );

    }
    ZIPCODER = "00" + StringService.toStringValue  ( ZP ) + "-" + StringService.toStringValue  ( ZP4 );
    NUMFAM = this.app.SS_SERV_GBL;
    if ( Compare.gt ( AUTO, " " ) ) 
    {
      AUTO = "X";
    }
    if ( Compare.gt ( RECER, " " ) ) 
    {
      RECER = "X";
    }
    if ( Compare.gt ( JUST, " " ) ) 
    {
      JUST = "X";
    }
    if ( Compare.gt ( PENA, " " ) ) 
    {
      PENA = "X";
    }
    if ( Compare.gt ( COOP, " " ) ) 
    {
      COOP = "X";
    }
    if ( Compare.gt ( OTROS, " " ) ) 
    {
      OTROS = "X";
    }
    if ( Compare.gt ( PENAL, " " ) ) 
    {
      PENAL = "X";
    }
    if ( Compare.gt ( DIR, " " ) ) 
    {
      DIR = "X";
    }
    if ( Compare.gt ( OTR, " " ) ) 
    {
      OTR = "X";
    }
    if ( Compare.gt ( ACEPT, " " ) ) 
    {
      ACEPT = "X";
    }
    if ( Compare.gt ( PART, " " ) ) 
    {
      PART = "X";
    }
    ADSEF_TANF_06A_PKT.exec ( this.app );
    return;

  }
